CREATE TRIGGER `update_item_quantity` AFTER INSERT ON `payment` FOR EACH ROW BEGIN
    DECLARE new_quantity INT;
    DECLARE item_quantity INT;

    -- Get the quantity from the payment table
    SET new_quantity = NEW.item_quantity_taken;

    -- Get the current quantity of the item from the item table
